import './App.css';
import React, {useState,useEffect } from 'react';
const hello = (symbol) => {
  fetch(`127.0.0.1:5000/v0/ticker?id =` + symbol, {
  method: 'GET',
  headers: new Headers({
    'Content-Type': 'application/x-www-form-urlencoded',
  }),
})
}
function App() {
  const [symbol, setSymbol] = useState("");
  useEffect(() => {
    hello(symbol);
  },[symbol]);
  return (
    <form>
      <input type = "text" name = "name"/>
      <input type = "submit"
      onChange= {(event) =>
      setSymbol(event.target.value)}
      value = "Submit" />
    </form>
  );
}

export default App;
